import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Import routing components
import './App.css';  // Ensure this file exists
import UserList from './components/UserList';  // Ensure this component exists
import LoginForm from './components/Auth/LoginForm'; // Import LoginForm component
import SignUpForm from './components/Auth/SignUpForm'; // Import SignUpForm component

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<UserList />} />
        <Route path="/login" element={<LoginForm />} />
        <Route path="/signup" element={<SignUpForm />} />
      </Routes>
    </div>
  );
}

export default App;
